import React from 'react';
import { Container, Row, Col, Card } from 'react-bootstrap';

function About() {
  return (
    <Container className="mt-3">
      <Row>
        <Col>
          <Card>
            <Card.Body>
              <Card.Title>About Esther Lee</Card.Title>
              <Card.Text>
                Esther Lee is a highly motivated and skilled Software Developer Engineer with a passion for developing innovative and efficient solutions. ...
                {/* Rest of the content remains the same */}
              </Card.Text>
              <Card.Link href="EstherLeeResume.pdf" target="_blank" rel="noopener noreferrer">
                View Esther's Resume
              </Card.Link>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default About;
